    - tag: RPMTAG_DESCRIPTION
      data:
        I18NString:
          - "Based on Rust programming language, StratoVirt is lightweight, efficient and safe. StratoVirt reduces memory resource consumption and improves VM startup speed while retains isolation capability and security capability of traditional virtualization. StratoVirt works with iSulad and Kata container, and can be integrated in Kubernetes ecosystem perfectly. The current version can be applied to microservices or serverless scenarios. StratoVirt reserves interface and design for importing more features, even standard virtualization.\n\nSummary:        StratoVirt is an opensource VMM(Virtual Machine Manager) which aims to perform next generation virtualization."
